import React from 'react';
import ReactDOM from 'react-dom' ;
import './index.css' ;
import Card from './Cards' ;
import Sdata from './Sdata' ;



ReactDOM.render(
  <>
    <h1 className = 'heading_style'> List of top 3 Netflix movies in 2k23</h1>
    {
    Sdata.map((val)=>{
      return (
        <Card 
        imgSrc = {val.imgSrc}
        title =  {val.title}
        sname =  {val.sname}
        link =   {val.link}
        />
      )
    })} ;

  </>

  ,document.getElementById('root') 
)
